// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface IERC165 {
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}

pragma solidity ^0.8.0;

interface IERC1155 is IERC165 {
    event TransferSingle(address indexed operator, address indexed from, address indexed to, uint256 id, uint256 value);

    event TransferBatch(
        address indexed operator,
        address indexed from,
        address indexed to,
        uint256[] ids,
        uint256[] values
    );

    event ApprovalForAll(address indexed account, address indexed operator, bool approved);

    event URI(string value, uint256 indexed id);

    function balanceOf(address account, uint256 id) external view returns (uint256);

    function balanceOfBatch(address[] calldata accounts, uint256[] calldata ids)
        external
        view
        returns (uint256[] memory);

    function setApprovalForAll(address operator, bool approved) external;

    function isApprovedForAll(address account, address operator) external view returns (bool);

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes calldata data
    ) external;

    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] calldata ids,
        uint256[] calldata amounts,
        bytes calldata data
    ) external;
}

pragma solidity ^0.8.0;

interface IERC1155Receiver is IERC165 {

    function onERC1155Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    ) external returns (bytes4);

    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    ) external returns (bytes4);
}

pragma solidity ^0.8.0;
interface IERC20 {

    event Transfer(address indexed from, address indexed to, uint256 value);

    event Approval(address indexed owner, address indexed spender, uint256 value);

    function totalSupply() external view returns (uint256);

    function balanceOf(address account) external view returns (uint256);

    function transfer(address to, uint256 amount) external returns (bool);

    function allowance(address owner, address spender) external view returns (uint256);

    function approve(address spender, uint256 amount) external returns (bool);

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);
}

pragma solidity ^0.8.0;

library SafeMath {

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        return a + b;
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        return a - b;
    }

    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        return a * b;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        return a / b;
    }

    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        return a % b;
    }

    function sub(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b <= a, errorMessage);
            return a - b;
        }
    }

    function div(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b > 0, errorMessage);
            return a / b;
        }
    }

    function mod(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b > 0, errorMessage);
            return a % b;
        }
    }
}

// File: contracts/shoplogic.sol

pragma solidity ^0.8.4;

interface i1155{
    struct SALE{
        uint256 saleid;
        uint256 expire;
        uint256[] settings;
        address[] addresses;
        bool active;
    }
    struct NFTEA {
        uint256 nftea;
        address[] addresses;
        uint256[] settings;
    }
    function getsell(uint256 saleid_) external returns(SALE memory forsale);

    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function getContract(address contract_) external returns(bool);
    function gflame(string memory flame_) external pure returns(address);
    function gspark(string memory spark_) external pure returns(uint256);
    function getnftea(uint256 nftea_) external pure returns(NFTEA memory _nfteas, string[] memory, string memory);
    function setunsell(uint256 saleid_) external returns(bool);
    function setsell(uint256[] memory, address[] memory addresses_) external returns(bool, uint256);
    function setroyaltea(uint256 label_, address token_, uint256 amount_, address buyer_) external returns(bool);
    function setbuyclose(uint256[] memory buysettings_,uint256 quantity_, uint256 saleid_,address buyer_) external returns(bool);
    function getoperatorrole(uint256 opid_) external view returns(uint256);
    function getoperator(address operator_, uint256 license_) external pure returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,uint256,address);
    function getpaysplit(uint256 saleid_) external returns(uint256,address);
    function getnftea2label(uint256 nftea_) external pure returns(uint256,uint256);
    function getNftea2lastmarket(uint256 nftea_, address buyer_) external pure returns(uint256,uint256,uint256,uint256);
    function balanceOf(address holder, uint256 nftea_) external pure returns(uint256);
    function setGasRefund(address holder_, uint256 gas_) external returns(bool);
    function setdisplay(uint256 label_, uint256 nft_, uint256 type_, address holder_) external returns(bool);
    function setOnDisplay(uint256 nftea_, bool value_, address holder_) external returns(bool);
    function getfee(string memory fee_) external pure returns(uint256);
    }
contract shoplogic{

    event sale(
        uint256 sellid,
        uint256 nftea,
        address seller,
        uint256 price,
        uint256 pricetype,
        uint256 label
    );
    event display(
      uint256 nftea,
      address holder,
      bool status
    );
    event labelBuyBonus(
        uint256 sellid,
        uint256 amount
    );
    event salecanceled(
        uint256 sellid
    );
    event saleclosed(
        uint256 saleid
    );
    event royaltea(
        uint256 amount,
        uint256 sellid
    );
    event fees(
        uint256 sellid,
        uint256 amount
    );
    event buy(
    uint256 sellid,
    uint256 price,
    uint256 quantity,
    address buyer

    );
    using SafeMath for uint256;
    string public name = "SHOP LOGIC V1";
    uint256 public _saleid;
    address public _fire;
    address public _burn = 0x000000000000000000000000000000000000dEaD;
    mapping(uint256=>uint256) public _sale2buycount;
    mapping(uint256=>mapping(address=>uint256)) public license2buyer2expiredate;
    mapping(uint256=>bool) public _salekilled;
    i1155.SALE forsale;
    i1155.NFTEA _nfteas;

    constructor(address fire_){
        _fire = fire_;
    }
    //label_ = goose2
    receive () external payable {}
    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }
    function expirecheck(uint256 mainlabel_, uint256 license_) public view returns(bool){
      (address flame_) = i1155(_fire).gflame('mintstorage');
      if(license_>0){
        (uint256 label_, uint256 expire_) = i1155(flame_).getnftea2label(license_);
        require(block.timestamp<expire_ || expire_ == 0, 'license expired');

        (, uint256 expire2_) = i1155(flame_).getnftea2label(label_);
        require(block.timestamp<expire2_ || expire2_ == 0, 'label expired');
      }
      if(mainlabel_>0 && license_<1){
        (, uint256 expire_) = i1155(flame_).getnftea2label(mainlabel_);
        require(block.timestamp<expire_ || expire_ == 0, 'label expired');
      }
      return true;
    }
    function licensecheck(uint256 marketplacelicense_,uint256 nftea_) public returns(uint256){
      //check if this is the same market the buyer bought from
      uint256 label_ = 0;
      bool okay = false;
      (address flame_) = i1155(_fire).gflame('shopstorage');
      (,uint256 lastmarket_,,) = i1155(flame_).getNftea2lastmarket(nftea_,msg.sender);
      if(marketplacelicense_>0){

          //check seller has marketplace license
          (flame_) = i1155(_fire).gflame('mintcontract');
          uint256 balance = IERC1155(flame_).balanceOf(msg.sender,marketplacelicense_);
          require(balance>0,'you do not own marketplace license');

          //check if marketing license is expired..
          (okay) = expirecheck(label_,0);
          require(okay, 'marketplace license, label expired');

          (flame_) = i1155(_fire).gflame('mintstorage');
          (_nfteas,,) = i1155(flame_).getnftea(marketplacelicense_);
          label_ = _nfteas.settings[0];

      }else if(marketplacelicense_<1 && lastmarket_>0){
          label_ = lastmarket_;
      }

      if(label_>0){
        (okay) = expirecheck(label_,0);
        require(okay, 'marketplace license, label expired');
      }
      return label_;
    }
    function validateoperator(uint256 label_) public view returns(uint256){

        uint256 opid_ = 0;
        (address flame_) = i1155(_fire).gflame('mintcontract');
        if(label_>0){
          //check if label is burned
          IERC1155 nft = IERC1155(flame_);
          require(nft.balanceOf(_burn, label_)<1,'label burned');
          //check if label is expired
          (bool okay) = expirecheck(label_,0);
          require(okay, 'label expired');
          //validate operator
          (flame_) = i1155(_fire).gflame('operatorstorage');
          (,,uint256 opidx_,uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,label_);
          if(opidx_>0){
              opid_ = opidx_;
              //seller has operator license for label
              require(block.timestamp<expirex_ || expirex_==0,'operator license expired 1');
              (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
              require(rolex_==1, 'you are not a super oerpertor');
          }
        }

        return (opid_);
    }
    function sell(uint256[] memory sellsettings_, uint256 price_, address[] memory selladdresses_) public{
        uint256 startGas = gasleft();
        require(sellsettings_[4]>0 || sellsettings_[6]>0, 'must use market license or operator license');
        uint256 opid_ = 0;
        uint256 marketlabel_ = 0;
        (address flame_) = i1155(_fire).gflame('mintstorage');
        sellsettings_[1] = price_;
        (_nfteas,,) = i1155(flame_).getnftea(sellsettings_[0]);
        selladdresses_[0] = msg.sender; //seller
        selladdresses_[3] = _nfteas.addresses[3]; //label wallet
        if(selladdresses_[3]==address(0)){
            selladdresses_[3] = msg.sender;
        }else if(_nfteas.addresses[1]!=msg.sender){
            //minter is not the seller, pay seller not label wallet
            selladdresses_[3] = msg.sender;
        }

        if(sellsettings_[2]==2){
            ///incremening price... quantity must be more than 1
            require(_nfteas.settings[6]>1, 'quantity should be more than 1');
        }
        if(sellsettings_[4]>0){
          ///marketing license used
            if(_nfteas.settings[0]!=sellsettings_[6]){
              (marketlabel_) = licensecheck(sellsettings_[4],sellsettings_[0]);
            }else{
              marketlabel_ = _nfteas.settings[0];
            }
            (_nfteas,,) = i1155(flame_).getnftea(marketlabel_);
            sellsettings_[5] = _nfteas.settings[11]; //sets label royalty
            sellsettings_[6] = marketlabel_;
            sellsettings_[7] = 0;
        }
        if(sellsettings_[6]>0){
          (opid_) = validateoperator(sellsettings_[6]);
          if(opid_>0){

              (flame_) = i1155(_fire).gflame('mintstorage');
              (_nfteas,,) = i1155(flame_).getnftea(sellsettings_[6]);
              sellsettings_[5] = _nfteas.settings[11];
              sellsettings_[7] = opid_;
          }
        }
        sellsettings_[10] = block.timestamp + 90 * 24 hours;
        (flame_) = i1155(_fire).gflame('mintcontract');
        IERC1155(flame_).safeTransferFrom(msg.sender,address(this),sellsettings_[0], sellsettings_[3],'');
        require(checkSuccess(), 'sale transfer failed');
        (bool worked) = sellcomplete(sellsettings_, selladdresses_);
        uint256 endGas = gasleft();
        uint256 gasUsed = startGas - endGas;
        uint256 refundAmount = gasUsed * tx.gasprice;
        (flame_) = i1155(_fire).gflame('teapot');
        (bool success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
        require(success, 'error settng gas refund');

        require(worked, 'error selling 2');
    }
    function sellcomplete(uint256[] memory sellsettings_, address[] memory selladdresses_) public returns(bool){

        (address flame_) = i1155(_fire).gflame('shopstorage');
        (bool worked,uint256 sellid_) = i1155(flame_).setsell(sellsettings_,selladdresses_);
        require(worked, 'error setting sell');
        emit sale(sellid_, sellsettings_[0], msg.sender, sellsettings_[1], sellsettings_[2],sellsettings_[6]);
        (flame_) = i1155(_fire).gflame('teapot');
        (worked) = i1155(flame_).setGasRefund(msg.sender,2);
        require(worked, 'error settng gas refund');
        return true;

    }
    function unsell(uint256 sellid_) public{
        uint256 startGas = gasleft();
        (address flame_) = i1155(_fire).gflame('shopstorage');
        (forsale) = i1155(flame_).getsell(sellid_);
        require(forsale.active, 'sale not active');
        require(forsale.addresses[0] == msg.sender || block.timestamp > forsale.expire || forsale.addresses[5] ==msg.sender, 'not allowed');
        (flame_) = i1155(_fire).gflame('mintcontract');
        IERC1155(flame_).safeTransferFrom(address(this),forsale.addresses[0],forsale.settings[0], forsale.settings[3],'');
        require(checkSuccess(), 'unsell failed');
        (flame_) = i1155(_fire).gflame('shopstorage');
        (bool success) = i1155(flame_).setunsell(sellid_);
        require(success, 'error unselling');
        uint256 endGas = gasleft();
        uint256 gasUsed = startGas - endGas;
        uint256 refundAmount = gasUsed * tx.gasprice;
        (flame_) = i1155(_fire).gflame('teapot');
        (success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
        require(success, 'error settng gas refund');
        emit salecanceled(sellid_);
    }

    function setdisplay(uint256 label_, uint256 nftea_, uint256 mplicense_, uint256 frontpage) public{
      uint256 startGas = gasleft();
      require(label_>0 || mplicense_>0, 'display to label or marketplace');
      bool okay = false;
      uint256 opid_ = 0;
      (address flame_) = i1155(_fire).gflame('mintstorage');
      (_nfteas,,) = i1155(flame_).getnftea(nftea_);
      require(_nfteas.addresses[2]!=address(0), 'uniques only for display');
      require(_nfteas.settings[3]==4 || _nfteas.settings[3]==8 || _nfteas.settings[3]==11, 'invalid type to display');
      if(label_>0){

        (okay) = expirecheck(label_,0);
        require(okay, 'label expired');
        (opid_) = validateoperator(label_);
        require(opid_>0, 'invalid operator');
        //set display

      }
      if(mplicense_>0){
        if(mplicense_==_nfteas.settings[0]){
          label_ = mplicense_;

        }else{
          (okay) = expirecheck(0,mplicense_);
          require(okay, 'license expired');
          (label_) = licensecheck(mplicense_,nftea_);
        }
        (okay) = expirecheck(label_,0);
        require(okay, 'label expired');
        //set display
      }
      (flame_) = i1155(_fire).gflame('shopstorage');
      (okay) = i1155(flame_).setdisplay(label_,nftea_,1,msg.sender);
      require(okay, 'error setting display');
      if(frontpage>0){

        (uint256 price_) = i1155(_fire).getfee('display');
        (address marketing_) =i1155(_fire).gflame("marketing");
        (address donate) =i1155(_fire).gflame("donate");
        (address paytoken_) =i1155(_fire).gflame("teatoken");
        if(price_>0){

          IERC20(paytoken_).transferFrom(msg.sender,marketing_,price_.div(2));
          require(checkSuccess(), 'error paying display fee');
          IERC20(paytoken_).transferFrom(msg.sender,donate,price_.div(2));
          require(checkSuccess(), 'error burning dispaly fee');

        }
        (flame_) = i1155(_fire).gflame('mintcontract');
        (okay) = i1155(flame_).setOnDisplay(nftea_,true,msg.sender);
        require(okay, 'error setting on display');

      }
      emit display(nftea_,msg.sender,true);
      uint256 endGas = gasleft();
      uint256 gasUsed = startGas - endGas;
      uint256 refundAmount = gasUsed * tx.gasprice;

      (flame_) = i1155(_fire).gflame('teapot');
      (bool success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
      require(success, 'error refunding gas');
    }
    function setdisplayoff(uint256 label_, uint256 nftea_) public {

      (address flame_) = i1155(_fire).gflame('shopstorage');
      (bool okay) = i1155(flame_).setdisplay(label_,nftea_,0,msg.sender);
      require(okay, 'error setting off display');

      (flame_) = i1155(_fire).gflame('mintcontract');
      (okay) = i1155(flame_).setOnDisplay(nftea_,false,msg.sender);
      require(okay, 'error setting off display');
      emit display(nftea_,msg.sender,false);

    }
    function setbuy(uint256 saleid_, uint256 nftea_, uint256 quantity_) public{

        uint256 startGas = gasleft();
        require(!_salekilled[saleid_], 'sale killed');
        (address flame_) = i1155(_fire).gflame('shopstorage');
        (forsale) = i1155(flame_).getsell(saleid_);
        require(forsale.active && forsale.settings[3]>0 && block.timestamp < forsale.expire, 'sale closed');
        bool success = true;
        forsale.addresses[1] = msg.sender;//buyer
        (success) = buysettings(forsale.settings, forsale.addresses, quantity_, saleid_);
        require(success, 'error buy settings');
        //check if purchased nft is a marketing license
        if(forsale.settings[8]==1){
            (flame_) = i1155(_fire).gflame('mintstorage');
            (_nfteas,,) = i1155(flame_).getnftea(nftea_);
            if(_nfteas.settings[4]>0){
                license2buyer2expiredate[nftea_][msg.sender] = block.timestamp + _nfteas.settings[4] * 30 days;
            }
        }
        uint256 endGas = gasleft();
        uint256 gasUsed = startGas - endGas;
        uint256 refundAmount = gasUsed * tx.gasprice;

        (flame_) = i1155(_fire).gflame('teapot');
        (success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
        require(success, 'error settng gas refund');

        emit buy(saleid_,forsale.settings[1],quantity_,msg.sender);
    }

    function buysettings(uint256[] memory sellsettings_, address[] memory addresses_, uint256 quantity_, uint256 saleid_) public returns(bool){

            bool success = false;
            uint256 total_ = 0;
            uint256 fees_ = 0;
            _sale2buycount[saleid_]+=1;
            if(sellsettings_[2]==2 && _sale2buycount[saleid_]>1){
                ///price increments every 6 buys
                if(_sale2buycount[saleid_]%6==0){
                    uint256 price_ = sellsettings_[1];
                    uint256 bumb_ = price_.div(100);
                    sellsettings_[1] = price_.add(bumb_);
                }
            }
            if(sellsettings_[1]>0){

                //sale price is > 0
                total_ = sellsettings_[1].mul(quantity_); ///total price
                fees_ = total_.mul(3).div(100); // total fees

            }
            addresses_[1] = msg.sender; //set last buyer
            address payto_ = address(0);
                ///opid > 0 || operator license was used, pay to label wallet address
                if(addresses_[3]!=address(0)){

                    payto_ = addresses_[3];
                }else{

                    payto_ = addresses_[0];
                }

            //if seller used marketers license thats split with label
            (address flame_) = i1155(_fire).gflame('shopstorage');
            (uint256 labelroyaltea_,) = i1155(flame_).getpaysplit(saleid_);

            if(labelroyaltea_>0){
                labelroyaltea_ = total_.sub(fees_).mul(labelroyaltea_).div(100);
                (flame_) = i1155(_fire).gflame('kettle');
                IERC20(addresses_[2]).transferFrom(msg.sender,flame_,labelroyaltea_);
                require(checkSuccess(), 'eror paying royalty to kettle');
                (success) = i1155(flame_).setroyaltea(sellsettings_[6],addresses_[2],labelroyaltea_,msg.sender);
                require(success, 'error setting royaltea');
                emit royaltea(labelroyaltea_,sellsettings_[6]);
            }
            uint256 sellerpay_ = total_.sub(fees_).sub(labelroyaltea_);
            if(sellerpay_>0){

                IERC20(addresses_[2]).transferFrom(msg.sender,payto_,sellerpay_);
                require(checkSuccess(), 'eror paying seller');
            }

            (success) = buyclose(sellsettings_, addresses_, fees_,quantity_,saleid_);
            require(success, 'error buy prep');
            return true;
    }
    function buyclose(uint256[] memory sellsettings_, address[] memory addresses_, uint256 fees_,uint256 quantity_,uint256 saleid_) internal returns (bool) {

            bool success = false;
            (address flame_) = i1155(_fire).gflame('mintcontract');
            if(sellsettings_[8]!=9){
                IERC1155(flame_).safeTransferFrom(address(this),msg.sender,sellsettings_[0], quantity_,'');
                require(checkSuccess(), 'buy nftea transfer failed');
            }else{
                IERC1155(flame_).safeTransferFrom(address(this),_burn,sellsettings_[0], quantity_,'');
                require(checkSuccess(), 'buy nftea transfer failed');
            }
            if(fees_>0){

                //if market label, pay 50% of fees to label wallet
                if(sellsettings_[6]>0){
                  (flame_) = i1155(_fire).gflame('mintstorage');
                  (_nfteas,,) = i1155(flame_).getnftea(sellsettings_[6]);
                  if(_nfteas.addresses[2]!=address(0)){
                    fees_ = fees_.div(2);
                    IERC20(addresses_[2]).transferFrom(msg.sender,_nfteas.addresses[2],fees_);
                    require(checkSuccess(), 'label buy commision failed');
                    emit labelBuyBonus(saleid_,fees_);
                  }
                }
                //pay service fee
                (success) = payfees(addresses_[2],fees_,saleid_);
                require(success,'error paying fees');

            }

            (flame_) = i1155(_fire).gflame('shopstorage');
            (success) = i1155(flame_).setbuyclose(sellsettings_,quantity_,saleid_,msg.sender);
            require(success,'error setting buy');
            return true;
    }

    function payfees(address paytoken_,uint256 servicefee_, uint256 saleid_) internal returns(bool){

        (address flame_) = i1155(_fire).gflame('marketing');
        IERC20(paytoken_).transferFrom(msg.sender,flame_,servicefee_);
        require(checkSuccess(), 'pay fees failed');
        emit fees(saleid_,servicefee_);
        return true;
    }
    function checkSuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;

        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()

            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }

            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }

            // not sure what was returned: dont mark as success
            default { }

        }

        return returnValue != 0;
    }
}
